negleadingcauses_1_1.query:
q = load "${App.Datasets.Cases_Leading_Causes_tp.FullyQualifiedName}";
q = filter q by ('LeadingCause' != "from the baseline") && ('LeadingCause' != "of other factors");
q = group q by 'LeadingCause';
q = foreach q generate 'LeadingCause' as 'LeadingCause', avg('Variance') as 'avg_Variance';
q = filter q by 'avg_Variance' < 0;
q = order q by 'avg_Variance' asc;
q = limit q 2000;

posleadingcauses_1_1.query:
q = load "${App.Datasets.Cases_Leading_Causes_tp.FullyQualifiedName}";
q = filter q by ('LeadingCause' != "from the baseline") && ('LeadingCause' != "of other factors");
q = group q by 'LeadingCause';
q = foreach q generate 'LeadingCause' as 'LeadingCause', avg('Variance') as 'avg_Variance';
q = filter q by 'avg_Variance' > 0;
q = order q by 'avg_Variance' desc;
q = limit q 2000;

lens_1.query:
q = load "${App.Datasets.ServiceCase_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate count() as 'count';
q = limit q 2000;
